css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("fiverr.com")

{

/*text&background*/

html, body, .gig-tooltip figure, tbody, thead, th, tr, td, blockquote, ul, h3, h4, h5, h6, font, strong, form, footer, fieldset, .main-category-search, .num, .body-db

{
color: white !important;
background: black !important;
}

nav, select, button, em, .gig-tag, .langs-list li, .db-container, .db-summary, .toggle-vacation-wrap, footer div, .gig-item, .wrapper-white, .mp-container, .container-fluid, .total-gig-counter span, .db-content, .dropdown-inner, .side-menu, .gig-main, .order-multi-block, .gig-stats-tags ul li, .btn-standard, .dropdown-toggle, .social-icons, .gig-social div, .btn-white, .gig-edit-form-section, .cover-photo-upload, .sel, .conv-write, .write-wrap div, .conv-message, .popup-content, .notify-menu,  .antiscroll-inner li, .db-order-activity, .order-messages, .order-gig-details, .rc-content, .rc-section, .rc-details, .order-countdown, .inn, .message-deliver-now, .popup.popup-grey header, .order-review-posted, .order-review, .order-status-lrg, .body-db, .btn-standard.disabled, .btn-standard-lrg.disabled, .desc-tooltip, .status-bar div, .locale-switcher p span, #Body, #Body div, #Head, .Item, .atm-s, #atic_auth, .atm-f, .Depth2 strong a, .span3, .span8, #Foot, .Box, .calc-exp, .calc-exp div, .mp-box, .box-row, .js-slide, .package-item, .inner, .menu-cont, .popup-new, .toggle-form-action, .in-progress

{
background: black !important;
}


em, select, input, span, code, textarea, pre, label, div, dd, option, h1, h2, .order-header-info li

{
color: white !important;
}


/*links*/

a

{
color: #0040ff !important;
}

a:visited

{
color: #2243bb !important;
}

/*highlight*/

textarea, pre, input, code, u, .Count, .status-bar-revenues div

{
background: #333333 !important;
}

/* site specifics */

figure
{
border: 1px solid #000000 !important;
}

}
